import Figure from 'react-bootstrap/Figure';
import '../css/Figura.css'
import january from'../img/january/january.png'
import february from'../img/february/february.png'
import march from'../img/march/march.png'
import april from'../img/april/april.png'
import may from'../img/may/may.png'
import june from'../img/june/june.png'
import july from'../img/july/july.png'
import august from'../img/august/august.png'
import september from'../img/september/september.png'
import october from'../img/october/october.png'
import november from'../img/november/november.png'
import december from'../img/december/december.png'

export function January() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={january}
        
        />
      
    </Figure>
  );
}


export function February() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={february}
        
      />
      
    </Figure>
  );
}

export function March() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={march}
        
      />
      
    </Figure>
  );
}

export function April() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={april}
        
      />
      
    </Figure>
  );
}



export function May() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={may}
        
      />
      
    </Figure>
  );
}

export function June() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={june}
        
      />
      
    </Figure>
  );
}

export function July() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={july}
        
      />
      
    </Figure>
  );
}

export function August() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={august}
        
      />
      
    </Figure>
  );
}

export function September() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={september}
        
      />
      
    </Figure>
  );
}

export function October() {
  const [isPopupOpen, setPopupOpen] = useState(false);

  const handleOpenPopup = () => {
    setPopupOpen(true);
  };

  const handleClosePopup = () => {
    setPopupOpen(false);
  };

  return (
    <div>
      <Figure className="Figure" onClick={handleOpenPopup} style={{ cursor: 'pointer' }}>
        <Figure.Image
          alt="171x180"
          src={october}
        />
      </Figure>

      {/* Popup */}
      {isPopupOpen && (
        <div className="overlay">
          <div className="popup">
            <button className="close-button" onClick={handleClosePopup}>
              &times;
            </button>
            <h2>Popup Content</h2>
            <p>This is a popup triggered by the October component.</p>
          </div>
        </div>
      )}
    </div>
  );
}

export function December() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={december}
        
      />
      
    </Figure>
  );
}

export function November() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={november}
        
      />
      
    </Figure>
  );
}
